INSERT INTO `campanas` VALUES (1,1,'ISBU-1','Launch event of ISBU, the Israel Security Business Union','<p style=\"text-align: center;\"><strong>Invitation to the launch event of ISBU, <br />the Israel Security Business Union <br />on 28.6/2021</strong></p>\r\n<p>&nbsp;</p>\r\n<p>[FirstName], please join us this event on<strong> 28.6.21 at 19:00 on</strong> the roof of Mindspace in Herzliya.</p>\r\n<p>This association, which was established from the Forum of CEOs from HLS &amp; Cyber industries, will improve the business cooperation of Israeli companies in Israel with government entities and abroad with the aim of creating a multiplier power with an emphasis on small and medium-sized companies to help them with the marketing processes.</p>\r\n<p>For more information about our association, visit this link <a href=\"http://www.isbunion.com\">www.isbunion.com</a></p>\r\n<p>The event is intended for the CEOs of [Company] and requires registration and a prepayment. Please here for the <a href=\"https://payboxapp.page.link/U9r89vu33BTdUAWB6\">Event Registration</a></p>\r\n<p>We look forward to see you at the event.</p>\r\n<p>On behalf of my friends from ISBU,</p>','2021-06-16 04:09:12','2021-06-16 08:09:12','2021-06-16 08:09:12'),(2,2,'ISBU-2','Launch event of ISBU, the Israel Security Business Union','<p style=\"text-align: center;\"><strong>Invitation to the launch event of ISBU, <br />the Israel Security Business Union <br />on 28.6/2021</strong></p>\r\n<p>&nbsp;</p>\r\n<p>[FirstName], please join us this event on<strong> 28.6.21 at 19:00 on</strong> the roof of Mindspace in Herzliya.</p>\r\n<p>This association, which was established from the Forum of CEOs from HLS &amp; Cyber industries, will improve the business cooperation of Israeli companies in Israel with government entities and abroad with the aim of creating a multiplier power with an emphasis on small and medium-sized companies to help them with the marketing processes.</p>\r\n<p>For more information about our association, visit this link <a href=\"http://www.isbunion.com\">www.isbunion.com</a></p>\r\n<p>The event is intended for the CEOs of [Company] and requires registration and a prepayment. Please here for the <a href=\"https://payboxapp.page.link/U9r89vu33BTdUAWB6\">Event Registration</a></p>\r\n<p>We look forward to see you at the event.</p>\r\n<p>On behalf of my friends from ISBU,</p>','2021-06-16 04:10:40','2021-06-16 08:10:40','2021-06-16 08:10:40'),(3,3,'ISBU-3','Launch event of ISBU, the Israel Security Business Union','<p style=\"text-align: center;\"><strong>Invitation to the launch event of ISBU, <br />the Israel Security Business Union <br />on 28.6/2021</strong></p>\r\n<p>&nbsp;</p>\r\n<p>[FirstName], please join us this event on<strong> 28.6.21 at 19:00 on</strong> the roof of Mindspace in Herzliya.</p>\r\n<p>This association, which was established from the Forum of CEOs from HLS &amp; Cyber industries, will improve the business cooperation of Israeli companies in Israel with government entities and abroad with the aim of creating a multiplier power with an emphasis on small and medium-sized companies to help them with the marketing processes.</p>\r\n<p>For more information about our association, visit this link <a href=\"http://www.isbunion.com\">www.isbunion.com</a></p>\r\n<p>The event is intended for the CEOs of [Company] and requires registration and a prepayment. Please here for the <a href=\"https://payboxapp.page.link/U9r89vu33BTdUAWB6\">Event Registration</a></p>\r\n<p>We look forward to see you at the event.</p>\r\n<p>On behalf of my friends from ISBU,</p>','2021-06-16 04:11:39','2021-06-16 08:11:39','2021-06-16 08:11:39');
